 {'turn id': 6, 'user utterance': "Huh... I actually haven't played first-person much, but I ended up really enjoying it in Morrowind. It felt really immersive and when I switched to third-person view for a moment, it felt strange.", 'system response': "Well, I'll still be hoping for an option to switch to third-person...", 'dialog history': "<USER> Barry!! Have you heard the news? They released a demo gameplay from Cyberpunk 2077! <SYSTEM> What, really? Where did you see that? <USER> <file_video> <SYSTEM> Holy shit, that's pretty impressive... I was pumped for the game already but now THIS is hype. Whoa. <USER> I know, right! I loved Wild Hunt but this is like a completely different level? <SYSTEM> It really is. I guess we'll see when the game gets released but for once the NPCs seemed like real people, even the crowds. They said they'd be working on that and now I'm sold. <USER> Yeah, they didn't move awkwardly or anything, it really felt like the world was alive. I can't wait!! <SYSTEM> It's only a shame about the POV... <USER> You don't like first-person? <SYSTEM> Well, I guess it's okay at times but I'd prefer over-the-shoulder. They say you can customise everything about your character so I'd kind of like to be able to see my gear because otherwise what's the point.", 'original user side information': '{"speaker": "Patricia"}', 'original system side information': '{"speaker": "Barry"}'}
