[{'turn id': 1, 'user utterance': 'Are you alive Paul?', 'system response': 'Yes. Why? :-)', 'dialog history': '', 'original user side information': '{"speaker": "Evelina"}', 'original system side information': '{"speaker": "Paul"}'}
 {'turn id': 2, 'user utterance': 'Been trying to reach you the whole morning of your Facetime.', 'system response': "I had my doctor's appointment at 9 am. I have been feeling some weird stomach pain for the last couple of days.", 'dialog history': '<USER> Are you alive Paul? <SYSTEM> Yes. Why? :-)', 'original user side information': '{"speaker": "Evelina"}', 'original system side information': '{"speaker": "Paul"}'}
 {'turn id': 3, 'user utterance': "Oh, is no good. How come you haven't told me anything?", 'system response': "Didn't want to worry you.", 'dialog history': "<USER> Are you alive Paul? <SYSTEM> Yes. Why? :-) <USER> Been trying to reach you the whole morning of your Facetime. <SYSTEM> I had my doctor's appointment at 9 am. I have been feeling some weird stomach pain for the last couple of days.", 'original user side information': '{"speaker": "Evelina"}', 'original system side information': '{"speaker": "Paul"}'}
 {'turn id': 4, 'user utterance': 'You should have told me. I could have helped you with something.', 'system response': 'It was not that bad. I have been able to do everything, is just that I was feeling pretty weird. And I could not really at anything.', 'dialog history': "<USER> Are you alive Paul? <SYSTEM> Yes. Why? :-) <USER> Been trying to reach you the whole morning of your Facetime. <SYSTEM> I had my doctor's appointment at 9 am. I have been feeling some weird stomach pain for the last couple of days. <USER> Oh, is no good. How come you haven't told me anything? <SYSTEM> Didn't want to worry you.", 'original user side information': '{"speaker": "Evelina"}', 'original system side information': '{"speaker": "Paul"}'}
 {'turn id': 5, 'user utterance': 'And what did the doctor say?', 'system response': "He said that is probably some indigestion as I don't have any other symptoms. No fever, vomitting or anything.", 'dialog history': "<USER> Are you alive Paul? <SYSTEM> Yes. Why? :-) <USER> Been trying to reach you the whole morning of your Facetime. <SYSTEM> I had my doctor's appointment at 9 am. I have been feeling some weird stomach pain for the last couple of days. <USER> Oh, is no good. How come you haven't told me anything? <SYSTEM> Didn't want to worry you. <USER> You should have told me. I could have helped you with something. <SYSTEM> It was not that bad. I have been able to do everything, is just that I was feeling pretty weird. And I could not really at anything.", 'original user side information': '{"speaker": "Evelina"}', 'original system side information': '{"speaker": "Paul"}'}
 {'turn id': 6, 'user utterance': "Ok, that's good. Did he give you any medicine or something?", 'system response': 'He gave me some herbs mix and if that does not help me told me to come back and they will do an ultrasound.', 'dialog history': "<USER> Are you alive Paul? <SYSTEM> Yes. Why? :-) <USER> Been trying to reach you the whole morning of your Facetime. <SYSTEM> I had my doctor's appointment at 9 am. I have been feeling some weird stomach pain for the last couple of days. <USER> Oh, is no good. How come you haven't told me anything? <SYSTEM> Didn't want to worry you. <USER> You should have told me. I could have helped you with something. <SYSTEM> It was not that bad. I have been able to do everything, is just that I was feeling pretty weird. And I could not really at anything. <USER> And what did the doctor say? <SYSTEM> He said that is probably some indigestion as I don't have any other symptoms. No fever, vomitting or anything.", 'original user side information': '{"speaker": "Evelina"}', 'original system side information': '{"speaker": "Paul"}'}
 {'turn id': 7, 'user utterance': 'Ok. Have you already got the medicine?', 'system response': 'No, not yet. I have been to a couple of pharmacies but they did not have it.', 'dialog history': "<USER> Are you alive Paul? <SYSTEM> Yes. Why? :-) <USER> Been trying to reach you the whole morning of your Facetime. <SYSTEM> I had my doctor's appointment at 9 am. I have been feeling some weird stomach pain for the last couple of days. <USER> Oh, is no good. How come you haven't told me anything? <SYSTEM> Didn't want to worry you. <USER> You should have told me. I could have helped you with something. <SYSTEM> It was not that bad. I have been able to do everything, is just that I was feeling pretty weird. And I could not really at anything. <USER> And what did the doctor say? <SYSTEM> He said that is probably some indigestion as I don't have any other symptoms. No fever, vomitting or anything. <USER> Ok, that's good. Did he give you any medicine or something? <SYSTEM> He gave me some herbs mix and if that does not help me told me to come back and they will do an ultrasound.", 'original user side information': '{"speaker": "Evelina"}', 'original system side information': '{"speaker": "Paul"}'}
 {'turn id': 8, 'user utterance': 'Have you tired the one by the Mobil gas station? They are always pretty well equipped.', 'system response': "No. I haven't been there. Will stop by there in the afternoon.", 'dialog history': "<USER> Are you alive Paul? <SYSTEM> Yes. Why? :-) <USER> Been trying to reach you the whole morning of your Facetime. <SYSTEM> I had my doctor's appointment at 9 am. I have been feeling some weird stomach pain for the last couple of days. <USER> Oh, is no good. How come you haven't told me anything? <SYSTEM> Didn't want to worry you. <USER> You should have told me. I could have helped you with something. <SYSTEM> It was not that bad. I have been able to do everything, is just that I was feeling pretty weird. And I could not really at anything. <USER> And what did the doctor say? <SYSTEM> He said that is probably some indigestion as I don't have any other symptoms. No fever, vomitting or anything. <USER> Ok, that's good. Did he give you any medicine or something? <SYSTEM> He gave me some herbs mix and if that does not help me told me to come back and they will do an ultrasound. <USER> Ok. Have you already got the medicine? <SYSTEM> No, not yet. I have been to a couple of pharmacies but they did not have it.", 'original user side information': '{"speaker": "Evelina"}', 'original system side information': '{"speaker": "Paul"}'}
 {'turn id': 9, 'user utterance': 'Let me know later if you bought it. If not I will look around too.', 'system response': 'Thanks. I will let you know. And I really appreciate your care.', 'dialog history': "<USER> Are you alive Paul? <SYSTEM> Yes. Why? :-) <USER> Been trying to reach you the whole morning of your Facetime. <SYSTEM> I had my doctor's appointment at 9 am. I have been feeling some weird stomach pain for the last couple of days. <USER> Oh, is no good. How come you haven't told me anything? <SYSTEM> Didn't want to worry you. <USER> You should have told me. I could have helped you with something. <SYSTEM> It was not that bad. I have been able to do everything, is just that I was feeling pretty weird. And I could not really at anything. <USER> And what did the doctor say? <SYSTEM> He said that is probably some indigestion as I don't have any other symptoms. No fever, vomitting or anything. <USER> Ok, that's good. Did he give you any medicine or something? <SYSTEM> He gave me some herbs mix and if that does not help me told me to come back and they will do an ultrasound. <USER> Ok. Have you already got the medicine? <SYSTEM> No, not yet. I have been to a couple of pharmacies but they did not have it. <USER> Have you tired the one by the Mobil gas station? They are always pretty well equipped. <SYSTEM> No. I haven't been there. Will stop by there in the afternoon.", 'original user side information': '{"speaker": "Evelina"}', 'original system side information': '{"speaker": "Paul"}'}
 {'turn id': 10, 'user utterance': 'No problem.', 'system response': 'Will keep you posted.', 'dialog history': "<USER> Are you alive Paul? <SYSTEM> Yes. Why? :-) <USER> Been trying to reach you the whole morning of your Facetime. <SYSTEM> I had my doctor's appointment at 9 am. I have been feeling some weird stomach pain for the last couple of days. <USER> Oh, is no good. How come you haven't told me anything? <SYSTEM> Didn't want to worry you. <USER> You should have told me. I could have helped you with something. <SYSTEM> It was not that bad. I have been able to do everything, is just that I was feeling pretty weird. And I could not really at anything. <USER> And what did the doctor say? <SYSTEM> He said that is probably some indigestion as I don't have any other symptoms. No fever, vomitting or anything. <USER> Ok, that's good. Did he give you any medicine or something? <SYSTEM> He gave me some herbs mix and if that does not help me told me to come back and they will do an ultrasound. <USER> Ok. Have you already got the medicine? <SYSTEM> No, not yet. I have been to a couple of pharmacies but they did not have it. <USER> Have you tired the one by the Mobil gas station? They are always pretty well equipped. <SYSTEM> No. I haven't been there. Will stop by there in the afternoon. <USER> Let me know later if you bought it. If not I will look around too. <SYSTEM> Thanks. I will let you know. And I really appreciate your care.", 'original user side information': '{"speaker": "Evelina"}', 'original system side information': '{"speaker": "Paul"}'}]

